import React from 'react';
import FormCelular from './FormCelular';
import FormPods from './FormPods';
import FormRelogio from './FormCelular';
import { Container } from './style'; // Ajuste o caminho conforme necessário

function AdminPage() {
    const [formSelecionado, setFormSelecionado] = useState('celulares');

    const handleSelectChange = (event) => {
      setFormSelecionado(event.target.value);
    };
  return (
    <Container>
        <FormCelular></FormCelular>
        <FormRelogio></FormRelogio>
        <FormPods></FormPods>

        <h1>Administração de Produtos</h1>
      <select onChange={handleSelectChange}>
        <option value="celulares">Celulares</option>
        <option value="acessorios">R</option>
        <option value="servicos">Serviços</option>
      </select>

      {formSelecionado === 'celulares' && <FormCelular />}
      {formSelecionado === 'relogios' && <FormRelogio />}
      {formSelecionado === 'servicos' && <FormularioServicos />}
    </Container>
  );
}

export default AdminPage;
